import style from "./MemoriesPrivacy.module.css";
import Page from "../../../Components/Page/Page";
import {
  LinkedinLogo,
  DribbbleLogo,
  InstagramLogo,
  TiktokLogo,
} from "phosphor-react";
import { motion } from "framer-motion";
import { ANIMATE_PROPS } from "../../../Animation";

const MemoriesPrivacy = () => {
  return (
    <Page marginTop={100} alternateBackground={true} heading="Privacy Policy">
      <motion.div {...ANIMATE_PROPS(0.75)} className={style.about}>
        Last Updated: [Date] 1. Introduction Welcome to [Your App Name] ("we,"
        "us," or "our"). We are committed to protecting your privacy and
        ensuring the security of your personal information. This Privacy Policy
        explains how we collect, use, and safeguard any data that we may collect
        from users of our iOS application. 2. Information We Do Not Collect We
        want to assure you that [Your App Name] does not collect any personal
        data or information from its users. We do not request access to your
        device's camera, microphone, contacts, location, or any other personal
        information. We do not use cookies, analytics tools, or any other
        tracking mechanisms to gather user information. 3. Third-Party Services
        Our app does not integrate with any third-party services, plugins, or
        APIs that would collect or access user data. 4. Children's Privacy Our
        app is not intended for use by children under the age of 13. We do not
        knowingly collect or solicit personal information from children. If you
        believe that we may have inadvertently collected such information,
        please contact us immediately at [your contact email]. 5. Changes to
        this Privacy Policy We reserve the right to modify this Privacy Policy
        at any time. If we make changes, we will post the updated Privacy Policy
        on our website and update the "Last Updated" date at the beginning of
        this document. We encourage you to review this Privacy Policy
        periodically to stay informed about our data practices. 6. Contact Us If
        you have any questions or concerns about this Privacy Policy or our
        privacy practices, please contact us at [your contact email]. By using
        [Your App Name], you consent to the terms of this Privacy Policy. Thank
        you for using [Your App Name]!
      </motion.div>
    </Page>
  );
};

export default MemoriesPrivacy;
